import { Box, Button, Fade, Typography } from '@mui/material';
import Modal from '@mui/material/Modal';
// import{makeStyles} from "@mui/styles"
import React, { useState, useContext } from 'react';
import {MyContext} from "../Context"
const style = {
    position: 'absolute' as 'absolute',
    top: '50%',
    left: '50%',
    transform: 'translate(-50%, -50%)',
    width: 400,
    bgcolor: 'background.paper',
    border: '2px solid #000',
    boxShadow: 24,
    p: 4,
};


interface Props { };

type State = {
    isOpen : boolean
}
// days: Array<IDay>,
// currentDay: IDay | null,
// currentIndex: number

// handleOpen: boolean
// handleClose: boolean
// open1: boolean
//   days: IDay[] | null
//   daysFiltered: IDay[] | null
// };
// const [isOpen, setOpen] = useState(false);
// const handleOpen = () => setOpen(true);
// const handleClose = () => setOpen(false);
// const useStyles = makeStyles(theme => ({
//     modal: {
//         display: 'flex',
//         alignItems: 'center',
//         justifyContent: 'center',
//     },
//     paper: {
//         backgroundColor: theme.palette.background.paper,
//         border: '2px solid #000',
//         boxShadow: theme.shadows[5],
//         padding: theme.spacing(2, 4, 3),
//     },
// }));
// const classes = useStyles();
// const varCon = React.useContext(MyContext)
// MyContext
export default class ModalItem extends React.Component {
    constructor(props: Props) {
        super(props);
        this.state = {

            // handleOpen: false,
            // handleClose: true,
            isOpen: false
        }
    }

    static contextType = MyContext;
    state = {
        isOpen: false
    };
    openModal = () => this.setState({ isOpen: true });
    closeModal = () => this.setState({ isOpen: false });
    
    componentDidMount() {
       
    }
    setUser(){
        alert("setUser");
    }
    // componentDidUpdate(prevProps: Readonly<{}>, prevState: Readonly<{}>, snapshot?: any): void {
    //      const uvar = this.context;
    //     console.log("uvar")
    //     console.log(uvar)
    // }
    render() {

        return (
            <>

                <div className="d-flex align-items-center justify-content-center"
                    style={{ height: "50vh" }}
                ></div>
                <Button onClick={this.openModal}>Open modal</Button>
                <Modal
                    open={this.state.isOpen} onClose={this.closeModal}>
                    <Fade in={this.state.isOpen}>
                        <div className="paper">
                            <h2>Animated React Modal</h2>
                            <p>
                                Lorem ipsum dolor sit amet, consectetur adipiscing elit. Morbi accumsan odio enim.
                            </p>
                            <MyContext.Consumer>
                                {({ user }) => (
                                    <div>
                                        <button
                                            onClick={this.setUser}
                                        >
                                            Toggle Theme
                                        </button>
                                        {user}
                                    </div>
                                )}
                            </MyContext.Consumer>
                        </div>
                    </Fade>
                    {/* <Box>
                        Woohoo, you're reading this text in a modal!
                    </Box> */}

                </Modal>
            </>
        )
    }
}
ModalItem.contextType = MyContext;
